import Layout from '../components/MyLayout';
import Header from '../components/Header';
import Link from 'next/link';

export default function Blog() {
  return (
    <Layout>
      <div className="container">
        <div className="info">
          <img src='/me.png'/>
          <div>Jack Diamond</div>
          <div>Full Stack Software Engineering Intern</div>
          <div className="logos">
            <img src='/linkedin-logo.png'/>
            <img src='/github-logo.png'/>
          </div>
        </div>
      </div>
      <style jsx>{`
        body {
          font-family: Sans-Serif;
        }
        .container {
          height: 100vh;
          background: white;
          display: flex;
          justify-content: center;
          align-items: center;
        }

        .info {
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
        }

        .info img {
          border-radius: 50%;
          height: 20rem;
          width: 20rem;
        }

        .logos {
          margin-top: 5px;
          display: flex;
          flex-direction: column;
        }

        .logos img {
          height: 3rem;
          width: 3rem;
        }

        h1,
        a {
          font-family: 'Arial';
        }
      `}</style>
    </Layout>
  );
}
